import {Prodotto1} from "./prodotto/Prodotto1";



export const ProdottoList = ({ prodotti = [] }) => {
  return (
    <div>
      <h1>Prodotti</h1>
      <ul>
        {prodotti.map((v, index) => {
          return (
            <li key={index}>
              <Prodotto1s
                title={v.title}
                about={v.about}
                size={v.size}
                price={v.price}
              />
            </li>
          );
        })}
      </ul>
    </div>
  );
};
